/**
 * WebSocket Proxy for Realtime
 *
 * WebSocket endpoint that proxies connections to the internal Phoenix realtime service.
 *
 * **Protocol:** WebSocket (not HTTP)
 *
 * **Authentication:**
 * - API Key: Pass `X-API-Key` as query parameter (required)
 * - JWT Token: Pass `token` as query parameter for user context (optional)
 *
 * **Connection URL:**
 * ```
 * ws://localhost:8000/realtime/socket?X-API-Key=<api_key>&token=<jwt_token>
 * ```
 *
 * **Phoenix Channel Protocol:**
 * - Join: `{"topic": "table:users", "event": "phx_join", "payload": {}, "ref": "1"}`
 * - Events: `insert`, `update`, `delete`
 * - Payload: `{"event": "INSERT", "table": "users", "new": {...}, "old": null}`
 *
 */
export const websocketRealtimeSocket = <ThrowOnError extends boolean = false>(options: Options<WebsocketRealtimeSocketData, ThrowOnError>) => (options.client ?? client).get<unknown, WebsocketRealtimeSocketErrors, ThrowOnError>({ url: '/realtime/socket', ...options });
